CREATE TABLE DEMOGRAFIA_BASICA (
    PROVINCIA           VARCHAR(50),
    ANIO                INTEGER,
    HOMBRES             INTEGER,
    MUJERES             INTEGER,
    CONSTRAINT PK_DEMO_BASICA PRIMARY KEY (PROVINCIA, ANIO)                
);




CREATE TABLE DEMOGRAFIA_AVANZADA (
    PROVINCIA           VARCHAR(50),
    RANGO_EDAD          VARCHAR(30),
    EDAD_MENOR          INTEGER,
    EDAD_MAYOR          INTEGER,
    SEXO                VARCHAR(1),
    ANIO                INTEGER,
    FECHA               DATE,
    NUMERO_HABITANTES   INTEGER,
    CONSTRAINT PK_DEMO_AVANZADA PRIMARY KEY (PROVINCIA, ANIO, RANGO_EDAD, SEXO)
);


